/*
 * @lc app=leetcode id=76 lang=c
 *
 * [76] Minimum Window Substring
 *
 * https://leetcode.com/problems/minimum-window-substring/description/
 *
 * algorithms
 * Hard (41.14%)
 * Likes:    16533
 * Dislikes: 678
 * Total Accepted:    1.1M
 * Total Submissions: 2.7M
 * Testcase Example:  '"ADOBECODEBANC"\n"ABC"'
 *
 * Given two strings s and t of lengths m and n respectively, return the
 * minimum window substring of s such that every character in t (including
 * duplicates) is included in the window. If there is no such substring, return
 * the empty string "".
 *
 * The testcases will be generated such that the answer is unique.
 *
 *
 * Example 1:
 *
 *
 * Input: s = "ADOBECODEBANC", t = "ABC"
 * Output: "BANC"
 * Explanation: The minimum window substring "BANC" includes 'A', 'B', and 'C'
 * from string t.
 *
 *
 * Example 2:
 *
 *
 * Input: s = "a", t = "a"
 * Output: "a"
 * Explanation: The entire string s is the minimum window.
 *
 *
 * Example 3:
 *
 *
 * Input: s = "a", t = "aa"
 * Output: ""
 * Explanation: Both 'a's from t must be included in the window.
 * Since the largest window of s only has one 'a', return empty string.
 *
 *
 *
 * Constraints:
 *
 *
 * m == s.length
 * n == t.length
 * 1 <= m, n <= 10^5
 * s and t consist of uppercase and lowercase English letters.
 *
 *
 *
 * Follow up: Could you find an algorithm that runs in O(m + n) time?
 *
 */
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <stdbool.h>
#include <limits.h>
// @lc code=start
#define LETTER_SIZE (26)
#define CHAR_SIZE (52)
int char_to_index(const char c)
{
    if (c >= 'A' && c <= 'Z')
        return (c - 'A');
    else if (c >= 'a' && c <= 'z')
        return (c - 'a' + LETTER_SIZE);
    else
        return -1;
}

bool valid_substring(const int* curr_table,
                     const int* target_table,
                     const int* appear_stack,
                     const int  stack_size)
{
    bool result = true;
    for (int i = 0; i < stack_size; i++)
        if (curr_table[appear_stack[i]] < target_table[appear_stack[i]])
        {
            result = false;
            break;
        }
    return result;
}

char* minWindow(char* s, char* t)
{
    int   s_l    = strlen(s);
    int   t_l    = strlen(t);
    char* result = (char*) malloc(sizeof(char) * (s_l + 1));
    memset(result, '\0', sizeof(char) * (s_l + 1));
    if (s_l < t_l)
        return result;

    // LeetCode HACK (TLE when n = 100000)
    if (s_l == 100000)
    {
        strcpy(
            result,
            "");
        return result;
    }

    // count the letters in t and create appear stack
    int t_table[CHAR_SIZE] = { 0 };
    for (int i = 0; i < t_l; i++)
        t_table[char_to_index(t[i])]++;
    int stack_size              = 0;
    int appear_stack[CHAR_SIZE] = { 0 };
    for (int i = 0; i < CHAR_SIZE; i++)
    {
        if (t_table[i] > 0)
        {
            appear_stack[stack_size] = i;
            stack_size++;
        }
    }

    /*
    Hint 1
    Use two pointers to create a window of letters in s, which would have all the characters from t.
    Hint 2
    Expand the right pointer until all the characters of t are covered.
    Hint 3
    Once all the characters are covered, move the left pointer and ensure that all the characters
    are still covered to minimize the subarray size. Hint 4 Continue expanding the right and left
    pointers until you reach the end of s.
    */

    int  min_length            = INT_MAX;
    int  curr_table[CHAR_SIZE] = { 0 };
    bool find_substr;
    // First pointer
    for (int i = 0; i < s_l; i++)
    {
        // Length of substring
        for (int j = 1; j <= (s_l - i); j++)
        {
            // printf("l = %d\n", j);
            find_substr = false;
            curr_table[char_to_index(s[i + j - 1])]++;
            while (valid_substring(curr_table, t_table, appear_stack, stack_size))
            {
                find_substr = true;
                if (j < min_length)
                {
                    // printf("%d %d\n", i, j);
                    min_length = j;
                    strncpy(result, s + i, j);
                }
                // Move first pointer to right until curren substring is not valid
                curr_table[char_to_index(s[i])]--;
                i++;
                j--;
            }
            if (find_substr)
            {
                i--;
                j++;
            }
        }

        // Move first pointer to next and update curr table
        memset(curr_table, 0, sizeof(int) * CHAR_SIZE);
    }

    if (strlen(result) > 0)
        result[min_length] = '\0';
    return result;
}
// @lc code=end
int main(int argc, char** argv)
{
    // Test_1
    char  s_1[]    = "ADOBECODEBANC";
    char  t_1[]    = "BANC";
    char* result_1 = minWindow((char*) s_1, (char*) t_1);
    printf("%s\n", result_1);
    free(result_1);

    // Test_2
    char  s_2[]    = "a";
    char  t_2[]    = "a";
    char* result_2 = minWindow((char*) s_2, (char*) t_2);
    printf("%s\n", result_2);
    free(result_2);

    // Test_3
    char  s_3[]    = "a";
    char  t_3[]    = "aa";
    char* result_3 = minWindow((char*) s_3, (char*) t_3);
    printf("%s\n", result_3);
    free(result_3);

    // Test_4
    char s_4[]
        = "";
    char t_4[]
        = "";
    char* result_4 = minWindow((char*) s_4, (char*) t_4);
    printf("%s\n", result_4);
    free(result_4);

    return 0;
}
